a.paramsGenerator:
__ht__function(data, val, index, node, oldVal, form) {//图片已经上传了至少两张
let imagesUpdated = form.rowData[1] && form.rowData[1].length >= 2;

//绑定组索引对应的函数处理，用来动态生成复杂的参数变量传入
switch(index){
    case 0:
    case 3:
        return form.button.text
    case 1:
        return form.button.index == 3;
    case 2:
        return form.button.index == 0;
    case 4://存放当前是哪个按钮的点击
        return [form.button.index,form.rowId];
    case 5:
        return form.rowId;
    case 6:
        if(form.button.index == 2){
            i.fileUpload((url)=>{
                console.trace(url);
                let attrtmp = 'ensure>0>textArea-ui1>a:value',
                    databak = 'ensure>0>datas>s:text',
                    urltmp = "<a href='" + url + "'>" + url + '</a>';
                node.a(attrtmp, form.rowData[0] + ' ' + urltmp + ' ' + '上传完毕！');
                node.a(databak).push(url);
                node.a('show',true);
            })
        }
        return [form.rowId];
    case 7:
        let open = imagesUpdated && form.button.index == 1;
        open && setTimeout(()=>{
            node.a('hide',true);
        },1500);
        return open;
    case 8:
        return !imagesUpdated && form.button.index == 1;
    default:
        break;
}

return val;}

